import React from "react";
import { BandContainer } from "./style";

const Band = ({ name, biography, image }) => (
  <BandContainer>
    <img src={image} alt={name} />
    <p>{name}</p>
    <p>{biography}</p>
  </BandContainer>
);

export default Band;
